import React from 'react';
import { Container,Row,Col} from 'react-bootstrap'
import './LandingPage.css';

const LandingPage = () =>{
    return(
        <div>
            <Row>
                <Col><div className="main"></div></Col>
                <Col>
                    <Row>LOGIN</Row>
                    <Row>SIGNUP</Row>
                </Col>
            </Row>
            
        </div>
        
    )
}

export default LandingPage;
